def MaximumGain(s, x, y):
    # process string in two passes
    # first pass: remove the more valuable pattern
    # second pass: remove the less valuable pattern
    
    first_pattern, second_pattern = ("ab", "ba") if x > y else ("ba", "ab")
    first_points, second_points = (x, y) if x > y else (y, x)
    
    def remove_pattern(string, pattern, points):
        stack = []
        total_points = 0
        
        for char in string:
            if stack and stack[-1] == pattern[0] and char == pattern[1]:
                stack.pop()  # remove pattern[0]
                total_points += points
            else:
                stack.append(char)
                
        return ''.join(stack), total_points
    
    # first pass
    remaining, points1 = remove_pattern(s, first_pattern, first_points)
    
    # second pass
    _, points2 = remove_pattern(remaining, second_pattern, second_points)
    
    return points1 + points2  

print(MaximumGain("aabbaaxybbaabb", 5, 4))
